import React, { Component } from 'react'

export default class FunctionalComponent extends Component {
    render() {
        return (
            <div>
                <div class="last_div">
                    <button class="btn">Message</button>
                    <button class="btn">Following</button>
                    <button class="btn">Message</button>
                </div>
            </div>
        )
    }
}
